import React, { useEffect, useState } from "react";
import { useParams, Link, useNavigate } from "react-router-dom";

export default function PRList() {
  const { owner, repo } = useParams();
  const [prs, setPRs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  // Fetch PRs
  useEffect(() => {
    const fetchPRs = async () => {
      const token = localStorage.getItem("authToken");
      if (!token) {
        setError("No authentication token found.");
        setLoading(false);
        return;
      }

      try {
        const res = await fetch(
          `http://localhost:5001/github/repos/${owner}/${repo}/pulls`,
          { headers: { Authorization: `Bearer ${token}` } }
        );

        if (!res.ok) {
          throw new Error(`Failed to fetch PRs: ${res.status}`);
        }

        const data = await res.json();
        setPRs(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchPRs();
  }, [owner, repo]);

  // Gradient mouse effect
  useEffect(() => {
    let targetAngle = 0;
    let currentAngle = 0;
    let rafId;

    const lerp = (start, end, factor) => start + (end - start) * factor;

    const updateGradient = () => {
      currentAngle = lerp(currentAngle, targetAngle, 0.1);
      document.body.style.background = `
        linear-gradient(
          ${currentAngle}deg,
          rgba(127, 128, 123, 0.85),
          rgba(8, 107, 255, 1) 50%,
          rgba(17, 23, 90, 1) 100%
        )
      `;
      rafId = requestAnimationFrame(updateGradient);
    };

    const handleMouseMove = (e) => {
      const { innerWidth } = window;
      const x = e.clientX / innerWidth;
      targetAngle = Math.round(360 * x);
    };

    window.addEventListener("mousemove", handleMouseMove);
    rafId = requestAnimationFrame(updateGradient);

    return () => {
      window.removeEventListener("mousemove", handleMouseMove);
      cancelAnimationFrame(rafId);
    };
  }, []);

  if (loading) {
    return (
      <div className="flex flex-col justify-center items-center min-h-screen text-white font-sans">
        <div className="w-12 h-12 border-4 border-indigo-500 border-t-transparent rounded-full animate-spin"></div>
        <p className="mt-4 text-indigo-400">Loading pull requests...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="flex flex-col justify-center items-center min-h-screen text-white font-sans">
        <p className="text-red-400 text-lg font-medium">⚠️ {error}</p>
        <Link
          to="/dashboard"
          className="mt-6 px-6 py-2 rounded-lg bg-red-500/20 border border-red-500 text-red-300 
          hover:bg-red-500/40 hover:shadow-[0_8px_20px_rgba(239,68,68,0.4)] transition duration-300"
        >
          Back to Dashboard
        </Link>
      </div>
    );
  }

  return (
    <div className="min-h-screen text-white px-[10%] py-10 font-sans transition-colors duration-500
      bg-gradient-to-br from-[#0a1a66] via-[#0d1b4d] to-[#020833]">
      
      {/* Header */}
      <div className="flex flex-col md:flex-row justify-between items-center mb-12">
        <h2 className="text-3xl font-bold tracking-wide">
          Pull Requests — <span className="text-indigo-300">{owner}/{repo}</span>
        </h2>
        <Link
          to="/dashboard"
          className="mt-4 md:mt-0 px-5 py-2 rounded-lg bg-red-500/20 border border-red-500 text-red-300
          hover:bg-red-500/40 hover:shadow-[0_8px_20px_rgba(239,68,68,0.4)] transition duration-300"
        >
          ⬅ Back
        </Link>
      </div>

      {/* PR Cards */}
      {prs.length === 0 ? (
        <p className="text-gray-400 text-center text-lg mt-12">
          No pull requests have been raised for this repository.
        </p>
      ) : (
        <div className="grid gap-8 md:grid-cols-2 lg:grid-cols-3">
          {prs
            .sort((a, b) => new Date(b.created_at) - new Date(a.created_at))
            .map((pr) => (
              <div
                key={pr.id}
                className="group relative p-6 rounded-xl
                  bg-gradient-to-br from-[#0a1a66] via-[#0d1b4d] to-[#020833]
                  border border-indigo-700/40 shadow-[0_4px_15px_rgba(0,0,0,0.5)]
                  hover:scale-105 hover:shadow-[0_12px_30px_rgba(99,102,241,0.5)]
                  hover:border-indigo-400/60 transition duration-500 ease-out"
              >
                <h5 className="text-xl font-semibold mb-2 group-hover:text-indigo-300 transition">
                  {pr.title}
                </h5>
                <p className="text-gray-400 text-sm mb-4 line-clamp-3">
                  #{pr.number} opened by <strong>{pr.user.login}</strong>
                </p>
                <p className="text-gray-400 text-sm mb-2">
                  Created: {new Date(pr.created_at).toLocaleDateString()}
                </p>
                <span
                  className={`px-2 py-1 rounded-md text-xs font-medium ${
                    pr.state === "open"
                      ? "bg-green-600 text-white"
                      : "bg-gray-600 text-gray-300"
                  }`}
                >
                  {pr.state.toUpperCase()}
                </span>
                <div className="mt-4 flex justify-end">
                  <button
                    className="px-3 py-1.5 rounded-lg bg-indigo-600/20 border border-indigo-600 text-indigo-300 
                      hover:bg-indigo-600/40 hover:transition duration-300"
                    onClick={() =>
                      navigate(`/repos/${owner}/${repo}/pulls/${pr.number}/details`)
                    }
                  >
                    View Details
                  </button>
                </div>
              </div>
            ))}
        </div>
      )}
    </div>
  );
}
